import React, { useState, useEffect, useRef } from "react";
import Papa from "papaparse";
import hotelData from "./clean_hotel_data.json";
import "./Hotels.css";
import NavBar from "../NavBar/Navbar";

// List of local images to randomize
const hotelImages = [
  require("./hotel.jpg"),
  require("./hotel1.jpg"),
  require("./hotel2.jpg"),
  require("./hotel3.jpg"),
  require("./hotel4.jpg"),
  require("./hotel5.jpeg"),
  require("./hotel6.jpg"),
  require("./hotel7.jpg"),
  require("./hotel8.jpeg"),
  require("./hotel9.jpg"),
  require("./hotel10.jpg"),
  require("./hotel11.jpeg"),
  require("./hotel12.jpg"),
  require("./hotel13.jpg"),
  require("./hotel14.jpg"),
  require("./hotel15.jpeg"),
];

const getRandomImage = (() => {
    let shuffledImages = [...hotelImages].sort(() => 0.5 - Math.random());
    let index = 0;
    return () => {
      if (index >= shuffledImages.length) index = 0;
      return shuffledImages[index++];
    };
  })();
  

// Generate random rating above 4.0 if not available
const getRandomRating = () => (Math.random() * 1.0 + 4.0).toFixed(1);

const Hotels = () => {
  const [hotelsByCity, setHotelsByCity] = useState({});
  const [ratings, setRatings] = useState({});
  const [hoveredHotel, setHoveredHotel] = useState(null); // Track hovered hotel

  useEffect(() => {
    // Fetch and parse CSV file
    fetch("./ratings.csv")
      .then((response) => response.text())
      .then((csvText) => {
        Papa.parse(csvText, {
          header: true,
          skipEmptyLines: true,
          complete: (result) => {
            const ratingsMap = {};
            result.data.forEach(({ name, rating, category }) => {
              ratingsMap[name] = { rating: parseFloat(rating), category };
            });
            setRatings(ratingsMap);
          },
        });
      });
  }, []);

  useEffect(() => {
    if (Object.keys(ratings).length === 0) return;

    const enrichedHotels = hotelData.map((hotel) => ({
      ...hotel,
      rating: ratings[hotel.name]?.rating || getRandomRating(),
      category: ratings[hotel.name]?.category || hotel.category,
      address: hotel.address || hotel.city, // If no address, use city
      price: hotel.price || "Price not available",
      facilities: hotel.facilities || "No facilities listed",
    }));

    const groupedHotels = enrichedHotels.reduce((acc, hotel) => {
      const { city } = hotel;
      if (!acc[city]) acc[city] = [];
      acc[city].push(hotel);
      return acc;
    }, {});

    // Sort by rating (highest first) and keep only top 10
    Object.keys(groupedHotels).forEach((city) => {
      groupedHotels[city] = groupedHotels[city]
        .sort((a, b) => b.rating - a.rating)
        .slice(0, 10);
    });

    setHotelsByCity(groupedHotels);
  }, [ratings]);

  const scrollRefs = useRef({});

  const scroll = (city, direction) => {
    const container = scrollRefs.current[city];
    if (container) {
      container.scrollBy({ left: direction === "left" ? -300 : 300, behavior: "smooth" });
    }
  };
  

  return (
    <div className="hotels-container">
      <NavBar />
      {Object.entries(hotelsByCity).map(([city, hotels]) => (
        <div key={city} className="city-section">
          <h2 className="city-title">Hotels in {city}</h2>
          <div className="scroll-container">
            <button className="scroll-btn left" onClick={() => scroll(city, "left")}>‚Üê</button>
            <div className="hotels-row" ref={(el) => (scrollRefs.current[city] = el)}>
              {hotels.map((hotel) => (
                <div
                key={hotel.id}
                className={`hotel-card ${hoveredHotel === hotel.id ? "expanded" : ""}`}
                onMouseEnter={() => setHoveredHotel(hotel.id)}
                onMouseLeave={() => setHoveredHotel(null)}
                >

                  <img src={getRandomImage()} alt={hotel.name} className="hotel-image" />
                  <h3>{hotel.name}</h3>
                  <p>‚≠ê {hotel.rating} ({hotel.category})</p>
                  {hoveredHotel === hotel.id && (
                    <div className="hotel-details">
                      <p><strong>üìç Address:</strong> {hotel.address}</p>
                      <p><strong>üí∞ Price:</strong> {hotel.price}</p>
                      <p><strong>üè® Facilities:</strong> {hotel.facilities}</p>
                    </div>
                  )}
                </div>
              ))}
            </div>
            <button className="scroll-btn right" onClick={() => scroll(city, "right")}>‚Üí</button>
          </div>
        </div>
      ))}
    </div>
  );
};

export default Hotels;
